import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { BrowserRouter as Router } from "react-router-dom";
import Auth0ProviderWithHistoryAdvocate from "./auth0-provider-with-history-advocate";
import Auth0ProviderWithHistoryA2J from "./auth0-provider-with-history-a2j";

// built using Semantic UI

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <Auth0ProviderWithHistoryAdvocate>
        <App />
      </Auth0ProviderWithHistoryAdvocate>
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
